MINISTRY OF FINANCE  
(Department of Financial Services)  
NOTIFICATION 
New Delhi, the 17th February, 2016  
G.S.R.     179(E).— In exercise of the powers conferred by sub-section (1) and clause (lb) of sub-section 
(2) of section 114, read with sub-sections (2) and (6) of section 110 of the Insurance Act, 1938 (4 of  1938), 
the Central Government hereby makes the following r ules, namely :- 
1.  Short title and commencement .—(1) These rules may be called the Insurance (Appe al to Securities 
Appellate Tribunal) Rules, 2016. 
(2) They shall come into force on the date of their  publication in the Official Gazette. 
2. Definitions. — 
(1) In these rules, unless the context otherwise re quires,- 
(a) "Act" means the Insurance Act, 1938 (4 of 1938) ; 
(b) "appeal" means an appeal preferred under sectio n 110 of the Act; 
(c) "Appellate Tribunal" means the Securities Appel late Tribunal, as defined in clause (16C) of sectio n 2 of 
the Act,  established under section 15K of the Secu rities and Exchange Board of India Act, 1992 (15 of  1992);  
(d) “Authority” means the Insurance Regulatory and Development Authority of India as defined in clause  
(1A) of section 2 of the Act,  established under su b-section (1) of section 3 of the  Insurance Regula tory and 
Development Authority Act, 1999 (41 of 1999);  
(e)  "Form" means the form appended to these rules;  
(f) “Member” means a Member of the Securities Appel late Tribunal appointed under  section 15L of the 
Securities and Exchange Board of India Act, 1992 (1 5 of 1992); 
(g) "party" includes both appellant and respondent in the appeal before the Appellate Tribunal ; 
(h) "Presiding Officer" means the Presiding Officer  of the Securities Appellate Tribunal appointed und er 
section 15L of the Securities and Exchange Board of  India Act, 1992(15 of 1992);  
(i) "Registrar" means the Registrar of the Appellat e Tribunal; 
(j) "registry" means the registry of the Appellate Tribunal; 
(k) “section” means a section of the Act.
